import './App.css';
import NavBar from './NavBar.js';
import HomePage from './HomePage.js';
import FooterPart from './footerPart.js';
import ComputerPage from './ComputerPage.jsx';
import CivilPage from './CivilPage.jsx';
import ElectricalPage from './ElectricalPage.jsx';
import AutomobilePage from './AutomobilePage.jsx';
import ElectronicsAndCommunicationPage from './ElectronicsAndCommunicationPage.jsx';
import MechanicalPage from './MechanicalPage.jsx';
import PharmacyPage from './PharmacyPage.jsx';
import EventsPage from './EventsPage.jsx';
import LoginPage from './LoginPage.jsx';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';

function App() {
  return (
    <>
    <Router>  
    <NavBar/>
      <Switch>
        <Route path="/HomePage" component={HomePage}/>
        <Route path="/ComputerPage" component={ComputerPage}/>
        <Route path="/CivilPage" component={CivilPage}/>
        <Route path="/AutomobilePage" component={AutomobilePage}/>
        <Route path="/PharmacyPage" component={PharmacyPage}/>
        <Route path="/ElectricalPage" component={ElectricalPage}/>
        <Route path="/ElectronicsAndCommunicationPage" component={ElectronicsAndCommunicationPage}/>
        <Route path="/MechanicalPage" component={MechanicalPage}/>
        <Route path="/EventsPage" component={EventsPage}/>
        <Route path="/FacultyLogin" component={LoginPage}/>
        <Route path="/AdminLogin" component={LoginPage}/>
      </Switch>
      <FooterPart/>
    </Router>
    </>
  );
}

export default App;
